$(function(){$(".contactForm").submit(function(e){e.preventDefault();$(this);var t=new FormData(this);$.ajax({url:"/contact/",type:"POST",data:t,contentType:!1,cache:!1,processData:!1}).done(function(e){"NOT_OK"==e.status?$(".form").prepend(e.message):($(".form").prepend(e.message),$(".contactForm").trigger("reset"))}).fail(function(e){$(".form").prepend(e.message)})})});